import React, { Component } from "react"
import "./App.css"

class ToDoPage extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <div>
        <h1>ToDo</h1>
      </div>
    )
  }
}

export default ToDoPage
